import React from "react";
import Header from "../common/Header";


const HomePage = () => {
  return (
    <>
      <Header pageTitle={"Home Page"} />
      <div className="mx-0 mt-4 p-4 bg-gray-100 border-b border-gray-600 justify-between">
        <h2 className="text-xl font-bold mb-2">Announcement</h2>
        <p></p>
      </div>
      <div className="announcement-section bg-gray-100 p-4 rounded-md shadow-md">
      <h2 className="text-xl font-bold mb-4">Announcement Section</h2>
      <div className="flex justify-between items-center">
        <p className="text-gray-700">Create Announcement</p>
        <button className="btn btn-primary">ADD NEW ANNOUNCEMENT</button>
      </div>
      <p className="text-gray-700 mt-2">Notify all students of your announcement</p>
    </div>
    </>
  );
};

export default HomePage;
